export class Partner {
  constructor(id, name, address, phone, logoContentType, logo, mail, webaddress, sponsorshipAmount, active) {
    this.id = id;
    this.name = name;
    this.address = address;
    this.phone = phone;
    this.logoContentType = logoContentType;
    this.logo = logo;
    this.mail = mail;
    this.webaddress = webaddress;
    this.sponsorshipAmount = sponsorshipAmount;
    this.active = active;
    this.active = this.active ?? false;
  }
}
export function getPartnerIdentifier(partner) {
  return partner.id;
}
